local function parseMonsterNameIntoMafiaFormat(monsterName, fightText)
	--mafia's table doesn't precede the names of the monsters
	--with "a " or "an " or spaces, this function attempts to
	--strip out those things
	--mafia's table was also inconsistent with cases, 
	--so I lowercased everything and will have to do so here as well
	
	local mafiaMonsterName = monsterName:lower()

	mafiaMonsterName = mafiaMonsterName:gsub("^a ", "")
	mafiaMonsterName = mafiaMonsterName:gsub("^an ", "")
	mafiaMonsterName = mafiaMonsterName:gsub("^ ", "")

	if ambiguousNames[mafiaMonsterName] then
		for lookFor, actualName in pairs(ambiguousNames[mafiaMonsterName]) do
			if fightText:contains(lookFor) then
				return actualName
			end
		end	
	end

	return mafiaMonsterName
end

local function beesIncreaser(monster_name, base_data)
	local bees = {
		[" beebee gunners"] = true,
		["a moneybee"] = true,
		["a mumblebee"] = true,
		["a beebee queue"] = true,
		["a bee swarm"] = true,
		["a buzzerker"] = true,
		["a Beebee King"] = true,
		["a bee thoven"] = true,
		["a Queen Bee"] = true,
	}

	local _, numberBees = monster_name:gsub("[bB]", "%0")
	if numberBees > 0 and not bees[monster_name] then
		local modifier = 1 + (numberBees * .2)
		base_data.Stats.HP = base_data.Stats.HP * modifier
		base_data.Stats.Atk = base_data.Stats.Atk * modifier
		base_data.Stats.Def = base_data.Stats.Def * modifier
	end
	
	return base_data
end

function get_monster_base_data(theMonster)
-- 	print("Fetching data for: " .. theMonster)
    local monster = deepcopy(monsterData[theMonster])
	if not monster then return nil end

    if monster.Stats.Scales then
        if monster.Stats.Scales.HP then
            monster.Stats.HP = monster.Stats.HP()
        end

        if monster.Stats.Scales.Atk then
            monster.Stats.Atk = monster.Stats.Atk()
        end

        if monster.Stats.Scales.Def then
            monster.Stats.Def = monster.Stats.Def()
        end
    end
    return monster
end

function getMonsterData(monsterName, fightText)
	local ml = estimate_ml()

	local item = estimate_modifier_bonuses()["Item Drops from Monsters"] or 0

	local monsterDataName = parseMonsterNameIntoMafiaFormat(monsterName, fightText)
	if monsterDataName == "tomb rat king" then ml = 0 end -- ML doesn't get reapplied when using rat tangles
	local base_data = get_monster_base_data(monsterDataName)

	local ml_increases = {
		HP = true,
		Atk = true,
		Def = true,
	}
	
	if base_data then
		local monster = {}
		if base_data.Stats then
			monster.Stats = {}
			for a, b in pairs(base_data.Stats) do
				if b == 0 then
					monster.Stats[a] = "?"
				elseif ml_increases[a] then
					if not base_data.Stats.Scales then
						monster.Stats[a] = math.max(b + ml, 1)
					else
						if not base_data.Stats.Scales[a] then
							monster.Stats[a] = math.max(b + ml, 1)
						else
							-- TODO: Should really just call the scaling computation here, since this is where the fight data is set
							monster.Stats[a] = b
						end
					end
				else
					monster.Stats[a] = b
				end
			end
			
			--In a bees hate you, monster's with b in their names get increased by 20% per b
			--This is AFTER ML is applied
			if ascensionpathid() == 4 then
				monster.Stats = beesIncreaser(monsterName, monster.Stats)
			end
		end
		if base_data.Items then
-- 			print("base items", base_data.Items)
			monster.Items = {}
			for idata in table.values(base_data.Items) do
				local newidata = {}
				for a, b in pairs(idata) do
					if a == "Chance" and not idata["pickpocket only"] then
						local p_base = b / 100
						local p_mod = p_base * (1 + item / 100)
						p_mod = math.max(math.min(p_mod, 1), 0)
						newidata[a] = round_down(p_mod * 100, 2)
					else
						newidata[a] = b
					end
				end
				table.insert(monster.Items, newidata)
			end
		end
		return monster
	else
		return nil
	end
end
